以下是一个使用 JavaScript 编写的异步客户端的例子。你可以在 example_js/wasi_http_client.js 中找到源码。以下的代码会向你展示如何发送一个异步 HTTP GET 请求。 async function get_test() { try { let ss = await net.connect('152.136.235.225:80'); let req = new http.WasiRequest(); req.headers = { 'Host': '152.136.235.225' }; req.uri = '/get?a=123'; req.method = 'GET'; ss.write(req.encode()); print('wait get'); await handle_response(ss); print('get end'); } catch (e) { print('catch:', e); }
} 以上代码可以在等待服务端应答的同时处理其他任务。当服务端返回数据后，handle_response() 会被异步调用，处理好数据后就会将内容打印出来。 async function handle_response(s) { let buf = new http.Buffer(); let resp = undefined; while (true) { buf.append(await s.read()); if (resp == undefined) { resp = buf.parseResponse(); } if (resp instanceof http.WasiResponse) { let resp_length = resp.bodyLength; if (typeof (resp_length) === "number") { if (buf.length >= resp.bodyLength) { print('resp.body'); print(newStringFromUTF8(buf.buffer)); break; } } else { throw new Error('no support'); } } }
} 使用以下 CLI 命令，就可以在 WasmEdge runtime 中运行以上的 JavaScript 代码。 cd example_js
wasmedge --dir .:. ../target/wasm32-wasi/release/wasmedge_quickjs.wasm wasi_http_client.js 将会有如下内容被打印出来。 { "args": { "a": "123" }, "data": "hello", "files": {}, "form": {}, "headers": { "Content-Length": "5", "Host": "152.136.235.225" }, "json": null, "origin": "20.124.39.106", "url": "http://152.136.235.225/post?a=123"
} 以上应用例子发出了两个 HTTP 请求，一个是 GET 请求另一个是 POST 请求。该应用会异步等待这两个请求的应答数据，并且哪一个先从服务端返回就先会处理哪个。从日志中你可以看到这两个请求的 handlers 是交错执行的。

