以下的例子是使用 JavaScript 运行了一个监听 8000 端口的 TCP 服务器。接收到的网络请求都会被异步处理。你可以在 example_js/wasi_net_echo.js 中找到源码。 import * as net from 'wasi_net'; async function handle_client(cs) { while (true) { try { let d = await cs.read(); if (d.byteLength <= 0) { break; } let s = newStringFromUTF8(d); cs.write('echo:' + s); } catch (e) { print(e); } }
} async function server_start() { let s = new net.WasiTcpServer(8000); for (var i = 0; i < 100; i++) { let cs = await s.accept(); handle_client(cs); }
} server_start(); 调用 server_start() 方法会在 8000 端口启动一个监听服务。当一个请求进入，会异步传给 handle_client() function 函数处理。这意味着当应用返回应答数据后，它又可以处理下一个进来的请求了。 使用以下 CLI 命令，就可以在 WasmEdge runtime 中运行这段 JavaScript 代码。因为它将作为一个服务运行，你最好是以后台应用的形式启动。 cd example_js
nohup wasmedge --dir .:. ../target/wasm32-wasi/release/wasmedge_quickjs.wasm wasi_net_echo.js & 然后你就可以向它发出网络请求，观察运行效果。 $ curl -d "WasmEdge" -X POST http://localhost:8000
echo:WasmEdge WasmEdge 的 wasi_net 包为 JavaScript 应用提供了一种自适应的动态网络栈。在很多高级用法中，我们基于这个包，设计了很多抽象良好的 API。在下一章节，我们会带着具体的常见应用，向你展示如何处理 HTTP 请求。在 React 服务器渲染文章 中，我们还将会讨论一下如何基于这种异步网络的 API 来创建一个 React 服务器渲染功能。

