假如你已经知道服务器的请问和应答都是基于 HTTP 协议的，这里有一些增强方法可以帮到你更好地处理这些请求。你可以在 example_js/wasi_http_echo.js 中找到源码。 import * as http from 'wasi_http';
import * as net from 'wasi_net'; async function handle_client(cs, handler_req) { let buffer = new http.Buffer(); while (true) { try { let d = await cs.read(); if (d.byteLength <= 0) { return; } buffer.append(d); let req = buffer.parseRequest(); if (req instanceof http.WasiRequest) { handler_req(cs, req); break; } } catch (e) { print(e); } }
} function handler_req(cs, req) { print("version=", req.version); print("uri=", req.uri); print("method=", req.method); print("headers=", Object.keys(req.headers)); print("body=", newStringFromUTF8(req.body)); let resp = new http.WasiResponse(); let body = 'echo:' + newStringFromUTF8(req.body); let r = resp.encode(body); cs.write(r);
} async function server_start() { try { let s = new net.WasiTcpServer(8000); for (var i = 0; i < 100; i++) { let cs = await s.accept(); try { handle_client(cs, handler_req); } catch (e) { print(e); } } } catch (e) { print(e); }
} server_start(); server_start() 方法会启动一个监听 8000 端口的服务。当请求进来，会被传给 handle_client() 方法来处理。当请求是合法的 HTTP 请求，对应的 handler 方法会调用 handle_req() 来解析对应的字段，组装新的 HTTP 应答，然后异步把应答数据发送回去。这意味着当应用发送完数据，又能继续处理下一个进来的请求了。 使用以下 CLI 命令，就可以在 WasmEdge runtime 中运行这段 JavaScript 代码。因为它将作为一个服务运行，你最好是以后台应用的形式运行。 cd example_js
nohup wasmedge --dir .:. ../target/wasm32-wasi/release/wasmedge_quickjs.wasm wasi_http_echo.js & 然后你就可以向它发出网络请求，观察运行效果。 $ curl -d "WasmEdge" -X POST http://localhost:8000
echo:WasmEdge 在异步 HTTP 网络编程中，开发者可以安全并高效地在 WasmEdge 中使用 JavaScript 创建强交互的应用，例如数据库驱动的微服务。

