import {renderToString} from 'react-dom/server'; import Home from './component/Home.jsx'; const content = renderToString(React.createElement(Home));
console.log(content); 目录中的 rollup.config.js 文件和 package.json 文件用于把 React SSR 的所有依赖和组件打包成一个 WasmEdge 可用的 JavaScript 文件。你可以使用 npm 命令来进行构建，构建产物会输出到 dist/main.js 文件里。 npm install
