下面这个代码片段定义了一个 Rust 函数，该函数可以作为一个 API 结合到 JavaScript 解释器中。 fn run_rust_function(ctx: &mut Context) { struct HelloFn; impl JsFn for HelloFn { fn call(_ctx: &mut Context, _this_val: JsValue, argv: &[JsValue]) -> JsValue { println!("hello from rust"); println!("argv={:?}", argv); JsValue::UnDefined } } ...
} 下面的代码展示了如何把这个 Rust 函数添加到 JavaScript 解释器中，并为该函数的 JavaScript API 指定一个签名 hi()，随之在 JavaScript 代码中调用它。 fn run_rust_function(ctx: &mut Context) { ... let f = ctx.new_function::<HelloFn>("hello"); ctx.get_global().set("hi", f.into()); let code = r#"hi(1,2,3)"#; let r = ctx.eval_global_str(code); println!("return value:{:?}", r);
} 执行的结果如下所示。 hello from rust
argv=[Int(1), Int(2), Int(3)]
return value:UnDefined 通过这个方法，你可以创建出一个带有自定义 API 函数的 JavaScript 解释器。这个解释器是运行在 WasmEdge 里的，并且可以通过 CLI 或者网络来执行调用了这些 API 函数的 JavaScript 代码。

114.body:
在 JavaScript API 的设计中，我们有时需要提供一个封装了数据以及函数的对象。在下面的示例中，我们为 JavaScript API 定义了一个 Rust 函数。 fn rust_new_object_and_js_call(ctx: &mut Context) { struct ObjectFn; impl JsFn for ObjectFn { fn call(_ctx: &mut Context, this_val: JsValue, argv: &[JsValue]) -> JsValue { println!("hello from rust"); println!("argv={:?}", argv); if let JsValue::Object(obj) = this_val { let obj_map = obj.to_map(); println!("this={:#?}", obj_map); } JsValue::UnDefined } } ...
} 然后，我们在 Rust 端创建一个"对象"，设置它的数据域，然后将该 Rust 函数注册为关联到该对象的 JavaScript 函数。 let mut obj = ctx.new_object();
obj.set("a", 1.into());
obj.set("b", ctx.new_string("abc").into()); let f = ctx.new_function::<ObjectFn>("anything");
obj.set("f", f.into()); 接下来，我们使这个 Rust "对象" 能在 JavaScript 解释器中作为 JavaScript 对象 test_obj 使用。 ctx.get_global().set("test_obj", obj.into()); 在 JavaScript 代码中，你可以直接将 test_obj 作为 API 的一部分使用了。 let code = r#" print('test_obj keys=',Object.keys(test_obj)) print('test_obj.a=',test_obj.a) print('test_obj.b=',test_obj.b) test_obj.f(1,2,3,"hi")
"#; ctx.eval_global_str(code); 代码执行的结果如下。 test_obj keys= a,b,f
test_obj.a= 1
test_obj.b= abc
