在前面的示例中，我们简单地演示了如何用 Rust 创建 JavaScript API。在这个例子中，我们将会创建一个完整的 Rust 模块并让它成为一个 JavaScript 对象 API。这个项目在文件夹 examples/embed_rust_module 中。你可以构建并将其当做一个标准的 Rust 应用，在 WasmEdge 中运行它。 cargo build --target wasm32-wasi --release
wasmedge --dir .:. target/wasm32-wasi/release/embed_rust_module.wasm 该对象的 Rust 实现，如下面这个模块所示。它含有数据域、构造函数、访问器、设置器以及函数。 mod point { use wasmedge_quickjs::*; #[derive(Debug)] struct Point(i32, i32); struct PointDef; impl JsClassDef<Point> for PointDef { const CLASS_NAME: &'static str = "Point\0"; const CONSTRUCTOR_ARGC: u8 = 2; fn constructor(_: &mut Context, argv: &[JsValue]) -> Option<Point> { println!("rust-> new Point {:?}", argv); let x = argv.get(0); let y = argv.get(1); if let ((Some(JsValue::Int(ref x)), Some(JsValue::Int(ref y)))) = (x, y) { Some(Point(*x, *y)) } else { None } } fn proto_init(p: &mut JsClassProto<Point, PointDef>) { struct X; impl JsClassGetterSetter<Point> for X { const NAME: &'static str = "x\0"; fn getter(_: &mut Context, this_val: &mut Point) -> JsValue { println!("rust-> get x"); this_val.0.into() } fn setter(_: &mut Context, this_val: &mut Point, val: JsValue) { println!("rust-> set x:{:?}", val); if let JsValue::Int(x) = val { this_val.0 = x } } } struct Y; impl JsClassGetterSetter<Point> for Y { const NAME: &'static str = "y\0"; fn getter(_: &mut Context, this_val: &mut Point) -> JsValue { println!("rust-> get y"); this_val.1.into() } fn setter(_: &mut Context, this_val: &mut Point, val: JsValue) { println!("rust-> set y:{:?}", val); if let JsValue::Int(y) = val { this_val.1 = y } } } struct FnPrint; impl JsMethod<Point> for FnPrint { const NAME: &'static str = "pprint\0"; const LEN: u8 = 0; fn call(_: &mut Context, this_val: &mut Point, _argv: &[JsValue]) -> JsValue { println!("rust-> pprint: {:?}", this_val); JsValue::Int(1) } } p.add_getter_setter(X); p.add_getter_setter(Y); p.add_function(FnPrint); } } struct PointModule; impl ModuleInit for PointModule { fn init_module(ctx: &mut Context, m: &mut JsModuleDef) { m.add_export("Point\0", PointDef::class_value(ctx)); } } pub fn init_point_module(ctx: &mut Context) { ctx.register_class(PointDef); ctx.register_module("point\0", PointModule, &["Point\0"]); }
