在 Rust 项目 中，你只需要用 “[wasmedge_bindgen] ”宏来注释 [你的函数](https ://github.com/second-state/WasmEdge-go-examples/blob/master/wasmedge-bindgen/go_BindgenFuncs/rust_bindgen_funcs/src/lib.rs) 。 这些带注释的函数将由 Rust 编译器自动检测并转换为可以从 wasmedge-bindgen GO SDK 调用的 WebAssembly 函数。 在下面的示例中，我们有几个 Rust 函数可以进行复杂的调用参数并返回复杂值。 use wasmedge_bindgen::*;
use wasmedge_bindgen_macro::*;
use num_integer::lcm;
use sha3::{Digest, Sha3_256, Keccak256};
use serde::{Serialize, Deserialize}; #[derive(Serialize, Deserialize, Debug)]
struct Point { x: f32, y: f32
} #[derive(Serialize, Deserialize, Debug)]
struct Line { points: Vec<Point>, valid: bool, length: f32, desc: String
} #[wasmedge_bindgen]
pub fn create_line(p1: String, p2: String, desc: String) -> Result<Vec<u8>, String> { let point1: Point = serde_json::from_str(p1.as_str()).unwrap(); let point2: Point = serde_json::from_str(p2.as_str()).unwrap(); let length = ((point1.x - point2.x) * (point1.x - point2.x) + (point1.y - point2.y) * (point1.y - point2.y)).sqrt(); let valid = if length == 0.0 { false } else { true }; let line = Line { points: vec![point1, point2], valid: valid, length: length, desc: desc }; return Ok(serde_json::to_vec(&line).unwrap());
} #[wasmedge_bindgen]
pub fn say(s: String) -> Result<Vec<u8>, String> { let r = String::from("hello "); return Ok((r + s.as_str()).as_bytes().to_vec());
} #[wasmedge_bindgen]
pub fn obfusticate(s: String) -> Result<Vec<u8>, String> { let r: String = (&s).chars().map(|c| { match c { 'A' ..= 'M' | 'a' ..= 'm' => ((c as u8) + 13) as char, 'N' ..= 'Z' | 'n' ..= 'z' => ((c as u8) - 13) as char, _ => c } }).collect(); Ok(r.as_bytes().to_vec())
} #[wasmedge_bindgen]
pub fn lowest_common_multiple(a: i32, b: i32) -> Result<Vec<u8>, String> { let r = lcm(a, b); return Ok(r.to_string().as_bytes().to_vec());
} #[wasmedge_bindgen]
pub fn sha3_digest(v: Vec<u8>) -> Result<Vec<u8>, String> { return Ok(Sha3_256::digest(&v).as_slice().to_vec());
} #[wasmedge_bindgen]
pub fn keccak_digest(s: Vec<u8>) -> Result<Vec<u8>, String> { return Ok(Keccak256::digest(&s).as_slice().to_vec());
} 你可以使用标准的 Cargo 命令构建 WebAssembly 字节码文件。 $ cd rust_bindgen_funcs
$ cargo build --target wasm32-wasi --release # 输出 WASM 将是 target/wasm32-wasi/release/rust_bindgen_funcs_lib.wasm. $ cp target/wasm32-wasi/release/rust_bindgen_funcs_lib.wasm ../
$ cd ../

