在 此示例 中，我们将演示如何从 Go 应用程序调用 基于 Rust 的 WebAssembly 函数 。特别是，我们将讨论如何传递字符串数据。 在 WebAssembly 中向 Rust 函数传递和返回复杂值的另一种方法是使用 wasm-bindgen 编译器工具。你可以在 这里 了解更多。 Rust 函数获取字符串的内存指针，并自己构造 Rust 字符串。 use std::ffi::{CStr, CString};
use std::mem;
use std::os::raw::{c_char, c_void}; #[no_mangle]
pub extern fn allocate(size: usize) -> *mut c_void { let mut buffer = Vec::with_capacity(size); let pointer = buffer.as_mut_ptr(); mem::forget(buffer); pointer as *mut c_void
} #[no_mangle]
pub extern fn deallocate(pointer: *mut c_void, capacity: usize) { unsafe { let _ = Vec::from_raw_parts(pointer, 0, capacity); }
} #[no_mangle]
pub extern fn greet(subject: *mut c_char) -> *mut c_char { let subject = unsafe { CStr::from_ptr(subject).to_bytes().to_vec() }; let mut output = b"Hello, ".to_vec(); output.extend(&subject); output.extend(&[b'!']); unsafe { CString::from_vec_unchecked(output) }.into_raw()
} 使用标准 Rust 编译器工具将 Rust 源代码编译成 WebAssembly 字节码应用程序： cd rust_memory_greet
cargo build --target wasm32-wasi
# 输出的 WASM 将是 `target/wasm32-wasi/debug/rust_memory_greet_lib.wasm`. Go SDK 应用程序 必须从 WasmEdge 虚拟机中调用 allocate 以获得一个指向字符串参数的指针。然后它将用这个指针调用 Rust 中的 greet 函数。在该函数返回后，Go 应用程序将调用 deallocate 来释放内存空间。 package main import ( "fmt" "os" "strings" "github.com/second-state/WasmEdge-go/wasmedge"
) func main() { wasmedge.SetLogErrorLevel() conf := wasmedge.NewConfigure(wasmedge.WASI) store := wasmedge.NewStore() vm := wasmedge.NewVMWithConfigAndStore(conf, store) wasi := vm.GetImportModule(wasmedge.WASI) wasi.InitWasi( os.Args[1:], os.Environ(), []string{".:."}, ) err := vm.LoadWasmFile(os.Args[1]) if err != nil { fmt.Println("failed to load wasm") } vm.Validate() vm.Instantiate() subject := "WasmEdge" lengthOfSubject := len(subject) // 为 subject 分配内存，并获得其指针 // 包括一个字节，用于我们在下面添加的 NULL 结束符 allocateResult, _ := vm.Execute("allocate", int32(lengthOfSubject+1)) inputPointer := allocateResult[0].(int32) // 将 subject 写入内存 mem := store.FindMemory("memory") memData, _ := mem.GetData(uint(inputPointer), uint(lengthOfSubject+1)) copy(memData, subject) // C-字符串，以 NULL 结束 memData[lengthOfSubject] = 0 // 运行 `greet` 函数。给出指向 subject 的指针 greetResult, _ := vm.Execute("greet", inputPointer) outputPointer := greetResult[0].(int32) pageSize := mem.GetPageSize() // 读取 `greet` 函数的结果 memData, _ = mem.GetData(uint(0), uint(pageSize * 65536)) nth := 0 var output strings.Builder for { if memData[int(outputPointer) + nth] == 0 { break } output.WriteByte(memData[int(outputPointer) + nth]) nth++ } lengthOfOutput := nth fmt.Println(output.String()) // 释放 subject 以及 output vm.Execute("deallocate", inputPointer, int32(lengthOfSubject+1)) vm.Execute("deallocate", outputPointer, int32(lengthOfOutput+1)) vm.Release() store.Release() conf.Release()
} 要构建 Go SDK 示例，请运行以下命令： go get github.com/second-state/WasmEdge-go/wasmedge@v0.10.0
go build greet_memory.go 现在你可以使用 Go 应用程序来运行从 Rust 编译的 WebAssembly 插件： $ ./greet_memory rust_memory_greet_lib.wasm
Hello, WasmEdge!

