在 此示例 中，我们将演示如何调用 基于 Rust 的 WebAssembly 函数 ，并在 Go 应用程序中传入和传出数组。 在 WebAssembly 中向 Rust 函数传递和返回复杂值的另一种方法是使用 wasm-bindgen 编译器工具。你可以在 这里 了解更多。 fib_array() 函数将一个数组作为调用参数，并用斐波那契数列填充它。或者，fib_array_return_memory() 函数返回一个斐波那契数列数组。 对于调用参数中的数组，Rust 函数 fib_array() 需要一个内存指针并使用 from_raw_parts 构造 Rust Vec。对于数组的返回值，Rust 函数 fib_array_return_memory() 只是返回指针。 use std::mem;
use std::os::raw::{c_void, c_int}; #[no_mangle]
pub extern fn allocate(size: usize) -> *mut c_void { let mut buffer = Vec::with_capacity(size); let pointer = buffer.as_mut_ptr(); mem::forget(buffer); pointer as *mut c_void
} #[no_mangle]
pub extern fn deallocate(pointer: *mut c_void, capacity: usize) { unsafe { let _ = Vec::from_raw_parts(pointer, 0, capacity); }
} #[no_mangle]
pub extern fn fib_array(n: i32, p: *mut c_int) -> i32 { unsafe { let mut arr = Vec::<i32>::from_raw_parts(p, 0, (4*n) as usize); for i in 0..n { if i < 2 { arr.push(i); } else { arr.push(arr[(i - 1) as usize] + arr[(i - 2) as usize]); } } let r = arr[(n - 1) as usize]; mem::forget(arr); r }
} #[no_mangle]
pub extern fn fib_array_return_memory(n: i32) -> *mut c_int { let mut arr = Vec::with_capacity((4 * n) as usize); let pointer = arr.as_mut_ptr(); for i in 0..n { if i < 2 { arr.push(i); } else { arr.push(arr[(i - 1) as usize] + arr[(i - 2) as usize]); } } mem::forget(arr); pointer
} 使用标准 Rust 编译器工具将 Rust 源代码编译成 WebAssembly 字节码应用程序： cd rust_access_memory
cargo build --target wasm32-wasi
# 输出的 WASM 将是 target/wasm32-wasi/debug/rust_access_memory_lib.wasm. Go SDK 应用程序 必须从 WasmEdge 虚拟机中调用 allocate ，以获得一个指向数组的指针。然后它将调用 Rust 中的fib_array()函数并传入指针。在函数返回后，Go 应用程序将使用 WasmEdge 的 store API，从调用参数（ fib_array() ）或返回值（ fib_array_return_memory() ）中的指针构建一个数组。Go 应用最终会调用 deallocate 来释放内存空间。 package main import ( "fmt" "os" "unsafe" "github.com/second-state/WasmEdge-go/wasmedge"
) func main() { wasmedge.SetLogErrorLevel() conf := wasmedge.NewConfigure(wasmedge.WASI) store := wasmedge.NewStore() vm := wasmedge.NewVMWithConfigAndStore(conf, store) wasi := vm.GetImportModule(wasmedge.WASI) wasi.InitWasi( os.Args[1:], os.Environ(), []string{".:."}, ) err := vm.LoadWasmFile(os.Args[1]) if err != nil { fmt.Println("failed to load wasm") } vm.Validate() vm.Instantiate() n := int32(10) p, err := vm.Execute("allocate", 4 * n) if err != nil { fmt.Println("allocate failed:", err) } fib, err := vm.Execute("fib_array", n, p[0]) if err != nil { fmt.Println("fib_rray failed:", err) } else { fmt.Println("fib_array() returned:", fib[0]) fmt.Printf("fib_array memory at: %p\n", unsafe.Pointer((uintptr)(p[0].(int32)))) mem := store.FindMemory("memory") if mem != nil { // int32 占用 4 个字节 fibArray, err := mem.GetData(uint(p[0].(int32)), uint(n * 4)) if err == nil && fibArray != nil { fmt.Println("fibArray:", fibArray) } } } fibP, err := vm.Execute("fib_array_return_memory", n) if err != nil { fmt.Println("fib_array_return_memory failed:", err) } else { fmt.Printf("fib_array_return_memory memory at: %p\n", unsafe.Pointer((uintptr)(fibP[0].(int32)))) mem := store.FindMemory("memory") if mem != nil { // int32 占用 4 个字节 fibArrayReturnMemory, err := mem.GetData(uint(fibP[0].(int32)), uint(n * 4)) if err == nil && fibArrayReturnMemory != nil { fmt.Println("fibArrayReturnMemory:", fibArrayReturnMemory) } } } _, err = vm.Execute("deallocate", p[0].(int32), 4 * n) if err != nil { fmt.Println("free failed:", err) } exitcode := wasi.WasiGetExitCode() if exitcode != 0 { fmt.Println("Go: Running wasm failed, exit code:", exitcode) } vm.Release() store.Release() conf.Release()
