在 此示例 中，我们将演示如何调用 基于 TinyGo 的 WebAssembly 函数 以及将数组传入和传出 Go 应用程序。 函数 fibArray 接收一个数组作为调用参数，并将其填入一个斐波那契数列。或者，fibArrayReturnMemory 函数返回斐波那契数列的数组。 package main import ( "fmt" "unsafe"
) func main() { println("in main") n := int32(10) arr := make([]int32, n) arrP := &arr[0] fmt.Printf("call fibArray(%d, %p) = %d\n", n, arrP, fibArray(n, arrP)) fmt.Printf("call fibArrayReturnMemory(%d) return %p\n", n, fibArrayReturnMemory(n))
} // 导出 fibArray
func fibArray(n int32, p *int32) int32 { arr := unsafe.Slice(p, n) for i := int32(0); i < n; i++ { switch { case i < 2: arr[i] = i default: arr[i] = arr[i-1] + arr[i-2] } } return arr[n-1]
} // 导出 fibArrayReturnMemory
func fibArrayReturnMemory(n int32) *int32 { arr := make([]int32, n) for i := int32(0); i < n; i++ { switch { case i < 2: arr[i] = i default: arr[i] = arr[i-1] + arr[i-2] } } return &arr[0]
} 使用 TinyGo 编译器工具将 Go 源代码编译成 WebAssembly 字节码应用程序： tinygo build -o fib.wasm -target wasi fib.go Go SDK 应用程序 必须从 WasmEdge 虚拟机中调用 malloc 以获得指向数组的指针。然后它将用这个指针调用TinyGo中的 fibArray() 函数。在函数返回后，Go应用程序使用 WasmEdge SDK 的 store API，从调用参数（ fibArray() ）或返回值（ fibArrayReturnMemory() ）中的指针构建一个数组。Go应用程序最终会调用 free 来释放内存空间。 package main import ( "fmt" "os" "unsafe" "github.com/second-state/WasmEdge-go/wasmedge"
