让我们从一个最简单的例子入手, 来看看如何在一个 Go 程序里编写 Host function。 先来编写一个简单的 rust 程序。国际惯例，Cargo.toml 不能少。 Cargo.toml: [package]
name = "rust_host_func"
version = "0.1.0"
edition = "2021" [lib]
crate-type = ["cdylib", "rlib"] [dependencies] 再来看看 Rust 代码是什么样的。 lib.rs: extern "C" { fn add(a: i32, b: i32) -> i32;
} #[no_mangle]
pub unsafe extern fn run() -> i32 { add(1, 2)
} 上述程序中的 add 函数被声明在 extern "C" 中, 这就是一个 Host Function。我们使用如下命令将这段 Rust 程序编译为 wasm: cargo build --target wasm32-wasi --release 然后我们使用 wasm2wat 来查看 wasm 文件的导入段: wasm2wat target/wasm32-wasi/release/rust_host_func.wasm | grep import 输出如下: (import "env" "add" (func $add (type 0))) 可以看到 add 函数被放到了默认名称为 env 的模块的导入段中. 接下来我们来看如何使用 WasmEdge-go SDK 来执行这段 wasm 程序. hostfunc.go: package main import ( "fmt" "os" "github.com/second-state/WasmEdge-go/wasmedge"
) func add(_ interface{}, _ *wasmedge.Memory, params []interface{}) ([]interface{}, wasmedge.Result) { // 将从 wasm 传过来的两个参数做加法运算 return []interface{}{params[0].(int32) + params[1].(int32)}, wasmedge.Result_Success
} func main() { vm := wasmedge.NewVM() // 使用默认名称 env 构建导入段对象 obj := wasmedge.NewImportObject("env") // 构建 Host Function 的参数和返回值类型 funcAddType := wasmedge.NewFunctionType( []wasmedge.ValType{ wasmedge.ValType_I32, wasmedge.ValType_I32, }, []wasmedge.ValType{ wasmedge.ValType_I32, }) hostAdd := wasmedge.NewFunction(funcAddType, add, nil, 0) // 将 Host Function 加入到导入段对象中 // 注意第一个参数 `add` 是 rust 中定义的外部函数的名称 obj.AddFunction("add", hostAdd) // 注册导入段对象 vm.RegisterImport(obj) // 加载, 验证并实例化 wasm 程序 vm.LoadWasmFile(os.Args[1]) vm.Validate() vm.Instantiate() // 执行 wasm 导出的函数并取得返回值 r, _ := vm.Execute("run") fmt.Printf("%d", r[0].(int32)) obj.Release() vm.Release()
} 编译并执行: go build
./hostfunc rust_host_func.wasm 程序输出 3 。 这样我们就完成了一个最简单的在 Host 中定义 Function, 并在 wasm 中调用的例子。 下面让我们尝试用 Host Function 做一些更有趣的事情.

