受 Wasm 里数据类型的制约, Host Function 只能传递如 int32 等少数几种基本类型的数据, 这就会大大限制 Host Function 的应用范围. 那有没有什么办法能让我们传递如 string 等复杂数据类型的数据呢？答案是当然可以， 下面我们就通过一个例子看看是如何做到的。 在这个例子中, 我们要统计 https://www.google.com 的网页源代码中 google 出现的次数。 例子的源代码在 这里 . 还是先上 Rust 代码。Cargo.toml 是必不可少的，只是我在这里省略了。 lib.rs: extern "C" { fn fetch(url_pointer: *const u8, url_length: i32) -> i32; fn write_mem(pointer: *const u8);
} #[no_mangle]
pub unsafe extern fn run() -> i32 { let url = "https://www.google.com"; let pointer = url.as_bytes().as_ptr(); // call host function to fetch the source code, return the result length let res_len = fetch(pointer, url.len() as i32) as usize; // malloc memory let mut buffer = Vec::with_capacity(res_len); let pointer = buffer.as_mut_ptr(); // call host function to write source code to the memory write_mem(pointer); // find occurrences from source code buffer.set_len(res_len); let str = std::str::from_utf8(&buffer).unwrap(); str.matches("google").count() as i32
} 在这段代码中, 引入了两个 Host Function: fetch 用于发送 http 请求以获取网页源代码 write_mem 用于把网页源代码写到 wasm 的内存 你可能已经看出来了, 要在 Host Function 里传递 string, 实际是通过传递这段 string 所在内存指针和长度来实现的. fetch 接收两个参数, 他们就分别是字符串 https://www.google.com 的指针和字节长度. fetch 在获取到源代码后, 将源码的字节长度做为返回值返回。Rust 在分配了此长度的内存后, 将内存指针传递给 write_mem, host 将源码写入到这段内存, 进而达到了返回 string 的目的. 编译的过程同上不再赘述, 接下来展示如何使用 WasmEdge-go SDK 来执行这段 Wasm 程序。 hostfun.go: package main import ( "fmt" "io" "os" "net/http" "github.com/second-state/WasmEdge-go/wasmedge"
) type host struct { fetchResult []byte
} // do the http fetch
func fetch(url string) []byte { resp, err := http.Get(string(url)) if err != nil { return nil } defer resp.Body.Close() body, err := io.ReadAll(resp.Body) if err != nil { return nil } return body
} // Host function for fetching
func (h *host) fetch(_ interface{}, mem *wasmedge.Memory, params []interface{}) ([]interface{}, wasmedge.Result) { // get url from memory pointer := params[0].(int32) size := params[1].(int32) data, _ := mem.GetData(uint(pointer), uint(size)) url := make([]byte, size) copy(url, data) respBody := fetch(string(url)) if respBody == nil { return nil, wasmedge.Result_Fail } // store the source code h.fetchResult = respBody return []interface{}{len(respBody)}, wasmedge.Result_Success
} // Host function for writting memory
func (h *host) writeMem(_ interface{}, mem *wasmedge.Memory, params []interface{}) ([]interface{}, wasmedge.Result) { // write source code to memory pointer := params[0].(int32) mem.SetData(h.fetchResult, uint(pointer), uint(len(h.fetchResult))) return nil, wasmedge.Result_Success
} func main() { conf := wasmedge.NewConfigure(wasmedge.WASI) vm := wasmedge.NewVMWithConfig(conf) obj := wasmedge.NewImportObject("env") h := host{} // Add host functions into the import object funcFetchType := wasmedge.NewFunctionType( []wasmedge.ValType{ wasmedge.ValType_I32, wasmedge.ValType_I32, }, []wasmedge.ValType{ wasmedge.ValType_I32, }) hostFetch := wasmedge.NewFunction(funcFetchType, h.fetch, nil, 0) obj.AddFunction("fetch", hostFetch) funcWriteType := wasmedge.NewFunctionType( []wasmedge.ValType{ wasmedge.ValType_I32 }, []wasmedge.ValType{}) hostWrite := wasmedge.NewFunction(funcWriteType, h.writeMem, nil, 0) obj.AddFunction("write_mem", hostWrite) vm.RegisterImport(obj) vm.LoadWasmFile(os.Args[1]) vm.Validate() vm.Instantiate() r, _ := vm.Execute("run") fmt.Printf("There are %d 'google' in source code of google.com\n", r[0]) obj.Release() vm.Release() conf.Release()
} 有了对 Rust 代码的理解, 这段 go 代码其实就很容易理解了。 比较关键的就是对 Wasm 内存的存取: mem.GetData(uint(pointer), uint(size)) 取得 Wasm 中网页的 url mem.SetData(h.fetchResult, uint(pointer), uint(len(h.fetchResult))) 将网页源码写入 wasm 内存 这个例子的编译执行步骤和前一个例子一模一样, 最后执行的结果是: There are 79 'google' in source code of google.com

