impobj.AddMemory("memory", hostmem) // 创建一个全局实例并将其添加到导出名称为 `global` 的导入对象中。
globtype := wasmedge.NewGlobalType(wasmedge.ValType_I32, wasmedge.ValMut_Var)
hostglob := wasmedge.NewGlobal(globtype, uint32(666))
globtype.Release()
impobj.AddGlobal("global", hostglob) // 导入对象应该被释放。
// 你应该 __NOT__ 释放添加到导入对象对象中的实例。
impobj.Release() 指定导入对象 wasmedge.NewWasiImportObject() API 可以创建和初始化 WASI 导入对象。 wasmedge.NewWasmEdgeProcessImportObject() API 可以创建和初始化 wasmedge_process 导入对象。 你可以创建这些导入对象对象并将它们注册到 Store 或 VM 对象中，而不是调整 Configure 对象中的设置。 wasiobj := wasmedge.NewWasiImportObject( os.Args[1:], // 参数 os.Environ(), // 环境 []string{".:."}, // 映射预打开
)
procobj := wasmedge.NewWasmEdgeProcessImportObject( []string{"ls", "echo"}, // 允许的命令 false, // 不允许所有命令
) // 将 WASI 和 WasmEdge_Process 注册到 VM 对象中。
vm := wasmedge.NewVM()
vm.RegisterImport(wasiobj)
vm.RegisterImport(procobj) // ... 执行一些 WASM 函数。 // 获取 WASI 退出代码。
exitcode := wasiobj.WasiGetExitCode()
// 如果 WASI 函数“_start”执行没有错误，则 `exitcode` 将为 0。
// 否则，它将返回相关的退出代码。 vm.Release()
// 应该删除导入对象。
wasiobj.Release()
procobj.Release() 例子 首先新建一个 Go 项目： mkdir wasmedge_test && cd wasmedge_test
go mod init wasmedge_test 假设 WAT 中有一个简单的 WASM，如下所示： (module (type $t0 (func (param i32 i32) (result i32))) (import "extern" "func-add" (func $f-add (type $t0))) (func (export "addTwo") (param i32 i32) (result i32) local.get 0 local.get 1 call $f-add)
) 创建并编辑 Go 文件 main.go，如下所示： package main import ( "fmt" "github.com/second-state/WasmEdge-go/wasmedge"
) // Host 函数体定义。
func host_add(data interface{}, mem *wasmedge.Memory, params []interface{}) ([]interface{}, wasmedge.Result) { // 添加：i32, i32 -> i32 res := params[0].(int32) + params[1].(int32) // 设置返回 returns := make([]interface{}, 1) returns[0] = res // 返回 return returns, wasmedge.Result_Success
} func main() { // 创建虚拟机对象。 vm := wasmedge.NewVM() // WASM 模块缓冲区。 wasmbuf := []字节{ /* WASM 头文件 */ 0x00, 0x61, 0x73, 0x6D, 0x01, 0x00, 0x00, 0x00, /* 类型部分 */ 0x01, 0x07, 0x01, /* 函数类型 {i32, i32} -> {i32} */ 0x60, 0x02, 0x7F, 0x7F, 0x01, 0x7F, /* 导入部分 */ 0x02, 0x13, 0x01, /* 模块名称：“extern” */ 0x06, 0x65, 0x78, 0x74, 0x65, 0x72, 0x6E, /* 外部名称：“func-add” */ 0x08, 0x66, 0x75, 0x6E, 0x63, 0x2D, 0x61, 0x64, 0x64, /* 导入描述：函数 0 */ 0x00, 0x00, /* 函数部分 */ 0x03, 0x02, 0x01, 0x00, /* 导出部分 */ 0x07, 0x0A, 0x01, /* 导出名称：`addTwo` */ 0x06, 0x61, 0x64, 0x64, 0x54, 0x77, 0x6F, /* 导出描述：函数 0 */ 0x00, 0x01, /* 代码部分 */ 0x0A, 0x0A, 0x01, /* 代码主体 */ 0x08, 0x00, 0x20, 0x00, 0x20, 0x01, 0x10, 0x00, 0x0B, } // 创建模块名称为 `extern` 的导入对象。 impobj := wasmedge.NewImportObject("extern") // 创建一个函数实例并将其添加到导出名称为 `func-add` 的导入对象中。 functype := wasmedge.NewFunctionType( []wasmedge.ValType{wasmedge.ValType_I32, wasmedge.ValType_I32}, []wasmedge.ValType{wasmedge.ValType_I32}, ) hostfunc := wasmedge.NewFunction(functype, host_add, nil, 0) functype.Release() impobj.AddFunction("func-add", hostfunc) // 将导入对象注册到 VM 中。 vm.RegisterImport(impobj) res, err := vm.RunWasmBuffer(wasmbuf, "addTwo", uint32(1234), uint32(5678)) if err == nil { fmt.Println("Get the result:", res[0].(int32)) } else { fmt.Println("Error message:", err.Error()) } impobj.Release() vm.Release()
} 然后，你可以使用 WasmEdge Golang SDK 构建和运行 Golang 应用程序： $ go get github.com/second-state/WasmEdge-go/wasmedge@v0.9.1
