下面的例子展示了一个计算二次方程根的 web 应用程序，请在这里查看 完整源代码 . 用户在 web 表单中输入 a, b, c 三个值，web 应用程序调用 web 服务 /solve，计算出二次方程的根。 a*X^2 + b*X + c = 0 X 的根展示在输入表单下面。 getting-started-with-rust-function HTML 文件 包含提交 web 表单到 /solve 的客户端 JavaScript，并且将结果放到页面的 #roots HTML 元素里。 $(function() { var options = { target: '#roots', url: "/solve", type: "post" }; $('#solve').ajaxForm(options);
}); /solve URL 端点后的 Node.js 应用程序 如下所示。他从输入表单中读取数据，将他们作为数组传递给 solve 函数，将返回结果放到 HTTP 返回内容中。 app.post('/solve', function (req, res) { var a = parseFloat(req.body.a); var b = parseFloat(req.body.b); var c = parseFloat(req.body.c); res.send(solve([a, b, c]))
}) 用 Rust 写的 solve 函数 ，运行在 WasmEdge Runtime。如果 JavaScript 端的调用参数是数组，Rust 函数接收到一个封装数组的 JSON 对象。在 Rust 代码中，我们首先解码 JSON，执行计算，然后返回一个 JSON 字符串的结果。 #[wasm_bindgen]
pub fn solve(params: &str) -> String { let ps: (f32, f32, f32) = serde_json::from_str(&params).unwrap(); let discriminant: f32 = (ps.1 * ps.1) - (4. * ps.0 * ps.2); let mut solution: (f32, f32) = (0., 0.); if discriminant >= 0. { solution.0 = (((-1.) * ps.1) + discriminant.sqrt()) / (2. * ps.0); solution.1 = (((-1.) * ps.1) - discriminant.sqrt()) / (2. * ps.0); return serde_json::to_string(&solution).unwrap(); } else { return String::from("not real numbers"); }
} 让我们试试。 rustwasmc build
npm install express # 这个应用程序需要 Node.js 的 express 框架
node node/server.js 在 web 浏览器中，输入 http://ip-addr:8080/ 来获取应用程序。注意：如果你使用的是 Docker，确保 Docker 容器中的 8080 端口映射到宿主的 8080 端口。 这就是二次方程的例子。

