在 Rust 和 JavaScript 之间除了可以传递字符串值外， rustwasmc 工具支持下面的数据类型。 Rust 调用参数可以是 i32、String、&str、Vec<u8> 和 &[u8] 的组合。 返回值可能是 i32 或者 String 或者 Vec<u8> 或者 void。 对于复杂的数据结构，比如结构体，你可以使用 JSON 字符串来传递数据。 支持了 JSON，你可以用任意数量的输入参数调用 Rust 函数，并返回任意数量、任意类型的结果。 函数示例 中的 Rust 程序 src/lib.rs 演示了如何传递多个不同类型的调用参数和返回结果。 #[wasm_bindgen]
pub fn obfusticate(s: String) -> String { (&s).chars().map(|c| { match c { 'A' ..= 'M' | 'a' ..= 'm' => ((c as u8) + 13) as char, 'N' ..= 'Z' | 'n' ..= 'z' => ((c as u8) - 13) as char, _ => c } }).collect()
} #[wasm_bindgen]
pub fn lowest_common_denominator(a: i32, b: i32) -> i32 { let r = lcm(a, b); return r;
} #[wasm_bindgen]
pub fn sha3_digest(v: Vec<u8>) -> Vec<u8> { return Sha3_256::digest(&v).as_slice().to_vec();
} #[wasm_bindgen]
pub fn keccak_digest(s: &[u8]) -> Vec<u8> { return Keccak256::digest(s).as_slice().to_vec();
} 最有意思的可能是 create_line() 函数。它需要两个 JSON 字符串，每一个都代表一个 Point 结构，返回一个 JSON 字符串代表 Line 结构。注意，Point 和 Line 结构都使用了 Serialize 和 Deserialize 注解，这样 Rust 编译器就会自动生成必要的代码来支持和 JSON 字符串之间的转换。 use wasm_bindgen::prelude::*;
use serde::{Serialize, Deserialize}; #[derive(Serialize, Deserialize, Debug)]
struct Point { x: f32, y: f32
} #[derive(Serialize, Deserialize, Debug)]
struct Line { points: Vec<Point>, valid: bool, length: f32, desc: String
} #[wasm_bindgen]
pub fn create_line (p1: &str, p2: &str, desc: &str) -> String { let point1: Point = serde_json::from_str(p1).unwrap(); let point2: Point = serde_json::from_str(p2).unwrap(); let length = ((point1.x - point2.x) * (point1.x - point2.x) + (point1.y - point2.y) * (point1.y - point2.y)).sqrt(); let valid = if length == 0.0 { false } else { true }; let line = Line { points: vec![point1, point2], valid: valid, length: length, desc: desc.to_string() }; return serde_json::to_string(&line).unwrap();
} #[wasm_bindgen]
pub fn say(s: &str) -> String { let r = String::from("hello "); return r + s;
} 然后，让我们来检查下 JavaScript 程序 app.js ，它展示了如何调用 Rust 函数。你可以看到，String 和 &str 在 JavaScript 是简单的字符串，i32 是数字，Vec<u8> 或者 &[8] 是 JavaScript Uint8Array。JavaScript 对象在传入或者从 Rust 函数结果返回需要通过 JSON.stringify() 或者 JSON.parse() 转换。 const { say, obfusticate, lowest_common_denominator, sha3_digest, keccak_digest, create_line } = require('./functions_lib.js'); var util = require('util');
const encoder = new util.TextEncoder();
console.hex = (d) => console.log((Object(d).buffer instanceof ArrayBuffer ? new Uint8Array(d.buffer) : typeof d === 'string' ? (new util.TextEncoder('utf-8')).encode(d) : new Uint8ClampedArray(d)).reduce((p, c, i, a) => p + (i % 16 === 0 ? i.toString(16).padStart(6, 0) + ' ' : ' ') + c.toString(16).padStart(2, 0) + (i === a.length - 1 || i % 16 === 15 ? ' '.repeat((15 - i % 16) * 3) + Array.from(a).splice(i - i % 16, 16).reduce((r, v) => r + (v > 31 && v < 127 || v > 159 ? String.fromCharCode(v) : '.'), ' ') + '\n' : ''), '')); console.log( say("WasmEdge") );
console.log( obfusticate("A quick brown fox jumps over the lazy dog") );
console.log( lowest_common_denominator(123, 2) );
console.hex( sha3_digest(encoder.encode("This is an important message")) );
console.hex( keccak_digest(encoder.encode("This is an important message")) ); var p1 = {x:1.5, y:3.8};
var p2 = {x:2.5, y:5.8};
var line = JSON.parse(create_line(JSON.stringify(p1), JSON.stringify(p2), "A thin red line"));
console.log( line ); 在运行 rustwasmc 来构建 Rust 库后，在 Node.js 环境中运行 app.js 会产生如下结果。 $ rustwasmc build
