我们有两个用 Rust 编写并被编译的 WebAssembly 函数。它们将部署在 sidecar 微服务中，分别执行图像处理和图像分类的任务。 虽然，我们的示例 WebAssembly 函数是用 Rust 编写的，但你也可以用 C/C++、Swift、Kotlin 和 AssemblyScript 编写并编译成 WebAssembly 函数。此外 WasmEdge 还支持运行 JavaScript 和 DSL 编写的函数。 grayscale 函数是一个 Rust 编写的程序，它通过 STDIN 读取图像数据，并将 grayscale 图像写入 STDOUT。 use image::{ImageFormat, ImageOutputFormat};
use std::io::{self, Read, Write};
fn main() { let mut buf = Vec::new(); io::stdin().read_to_end(&mut buf).unwrap(); let image_format_detected: ImageFormat = image::guess_format(&buf).unwrap(); let img = image::load_from_memory(&buf).unwrap(); let filtered = img.grayscale(); let mut buf = vec![]; match image_format_detected { ImageFormat::Gif => { filtered.write_to(&mut buf, ImageOutputFormat::Gif).unwrap(); } _ => { filtered.write_to(&mut buf, ImageOutputFormat::Png).unwrap(); } }; io::stdout().write_all(&buf).unwrap(); io::stdout().flush().unwrap();
} 然后，我们使用 rustwasmc 进行构建，将构建好的 wasm 文件复制到 image-api-rs sidecar 中。 cd functions/grayscale
rustup override set 1.50.0
