pub async fn run_server(port: u16) { pretty_env_logger::init(); let home = warp::get().map(warp::reply); let image = warp::post().and(warp::path("api")) .and(warp::path("image")) .and(warp::body::bytes()) .map(|bytes: bytes::Bytes| { let v: Vec<u8> = bytes.iter().map(|&x| x).collect(); let res = image_process(&v); Ok(Box::new(res)) }); let routes = home.or(image); let routes = routes.with(warp::cors().allow_any_origin()); let log = warp::log("dapr_wasm"); let routes = routes.with(log); warp::serve(routes).run((Ipv4Addr::UNSPECIFIED, port)).await
} 一旦它接收到通过 HTTP POST 请求发送的图像文件，就会调用 WasmEdge 中的 WebAssembly 函数来执行图像处理任务。它创建一个 WasmEdge 实例来与 WebAssembly 程序交互。 pub fn image_process(buf: &Vec<u8>) -> Vec<u8> { let mut child = Command::new("./lib/wasmedge-tensorflow-lite") .arg("./lib/grayscale.wasm") .stdin(Stdio::piped()) .stdout(Stdio::piped()) .spawn() .expect("failed to execute child"); { // limited borrow of stdin let stdin = child.stdin.as_mut().expect("failed to get stdin"); stdin.write_all(buf).expect("failed to write to stdin"); } let output = child.wait_with_output().expect("failed to wait on child"); output.stdout
} 执行以下 Dapr CLI 命令将在 Dapr runtime 环境中启动 image-api-rs 微服务。 cd image-api-rs
