处理 YoMo 图像流的 图像分类函数 是 Rust 写的。它利用 WasmEdge Tensorflow API 来处理输入图像。 #[wasmedge_bindgen]
pub fn infer(image_data: Vec<u8>) -> Result<Vec<u8>, String> { let start = Instant::now(); // 导入 TFLite 模型和其元数据（每个被识别对象编号的文本标签） let model_data: &[u8] = include_bytes!("lite-model_aiy_vision_classifier_food_V1_1.tflite"); let labels = include_str!("aiy_food_V1_labelmap.txt"); // 将图像进行预处理成该模型可以使用的规范模式 let flat_img = wasmedge_tensorflow_interface::load_jpg_image_to_rgb8(&image_data[..], 192, 192); println!("RUST: Loaded image in ... {:?}", start.elapsed()); // 使用 WasmEdge TensorFlow API 运行 TFLite 模型 let mut session = wasmedge_tensorflow_interface::Session::new(&model_data, wasmedge_tensorflow_interface::ModelType::TensorFlowLite); session.add_input("input", &flat_img, &[1, 192, 192, 3]) .run(); let res_vec: Vec<u8> = session.get_output("MobilenetV1/Predictions/Softmax"); // 在 res_vec 中找到概率最大的对象索引 // 将概率转换为置信水平 // 将模型元数据 food_name 中的对象索引转换为标签 let mut i = 0; let mut max_index: i32 = -1; let mut max_value: u8 = 0; while i < res_vec.len() { let cur = res_vec[i]; if cur > max_value { max_value = cur; max_index = i as i32; } i += 1; } println!("RUST: index {}, prob {}", max_index, max_value); let confidence: String; if max_value > 200 { confidence = "is very likely".to_string(); } else if max_value > 125 { confidence = "is likely".to_string(); } else { confidence = "could be".to_string(); } let ret_str: String; if max_value > 50 { let mut label_lines = labels.lines(); for _i in 0..max_index { label_lines.next(); } let food_name = label_lines.next().unwrap().to_string(); ret_str = format!( "It {} a <a href='https://www.google.com/search?q={}'>{}</a> in the picture", confidence, food_name, food_name ); } else { ret_str = "It does not appears to be a food item in the picture.".to_string(); } println!( "RUST: Finished post-processing in ... {:?}", start.elapsed() ); return Ok(ret_str.as_bytes().to_vec());
} 你应该把 wasm32-wasi 目标添加到 rust，用以将此函数编译为 WebAssembly 字节码。 rustup target add wasm32-wasi cd flow/rust_mobilenet_food
cargo build --target wasm32-wasi --release
# 编译生成的 WASM 字节码文件就是 target/wasm32-wasi/release/rust_mobilenet_food_lib.wasm # 把 wasm 字节码文件拷贝到 flow/ 目录
cp target/wasm32-wasi/release/rust_mobilenet_food_lib.wasm ../ 为了释放 WasmEdge 的最佳性能，你应该使用 wasmedgec 将 .wasm 文件编译为原生二进制文件来启用 AOT 模式。 wasmedgec rust_mobilenet_food_lib.wasm rust_mobilenet_food_lib.wasm

