在 YoMo 方面，我们使用 WasmEdge Go 语言 API 来启动和运行 WasmEdge 虚拟机来实现图像分类功能。下面是源码项目中的 app.go 文件。 package main import ( "crypto/sha1" "fmt" "log" "os" "sync/atomic" "github.com/second-state/WasmEdge-go/wasmedge" bindgen "github.com/second-state/wasmedge-bindgen/host/go" "github.com/yomorun/yomo"
) var ( counter uint64
) const ImageDataKey = 0x10 func main() { // 连接 Zipper 服务 sfn := yomo.NewStreamFunction("image-recognition", yomo.WithZipperAddr("localhost:9900")) defer sfn.Close() // 设置监控数据 sfn.SetObserveDataID(ImageDataKey) // 设置 handler sfn.SetHandler(Handler) // 启动 err := sfn.Connect() if err != nil { log.Print("❌ Connect to zipper failure: ", err) os.Exit(1) } select {}
} // Handler 处理流式数据
func Handler(img []byte) (byte, []byte) { // 初始化 WasmEdge 虚拟机 vmConf, vm := initVM() bg := bindgen.Instantiate(vm) defer bg.Release() defer vm.Release() defer vmConf.Release() // 识别图像 res, err := bg.Execute("infer", img) if err == nil { fmt.Println("GO: Run bindgen -- infer:", string(res)) } else { fmt.Println("GO: Run bindgen -- infer FAILED") } // 打印 log hash := genSha1(img) log.Printf("✅ received image-%d hash %v, img_size=%d \n", atomic.AddUint64(&counter, 1), hash, len(img)) return 0x11, nil
} // genSha1 生成图像的哈希值
func genSha1(buf []byte) string { h := sha1.New() h.Write(buf) return fmt.Sprintf("%x", h.Sum(nil))
} // initVM 初始化 WasmEdge 虚拟机
func initVM() (*wasmedge.Configure, *wasmedge.VM) { wasmedge.SetLogErrorLevel() // 设置 Tensorflow 不要打印调试信息 os.Setenv("TF_CPP_MIN_LOG_LEVEL", "3") os.Setenv("TF_CPP_MIN_VLOG_LEVEL", "3") // 创建配置信息 vmConf := wasmedge.NewConfigure(wasmedge.WASI) // 根据配置信息创建虚拟机 vm := wasmedge.NewVMWithConfig(vmConf) // 初始化 WASI var wasi = vm.GetImportObject(wasmedge.WASI) wasi.InitWasi( os.Args[1:], // The args os.Environ(), // The envs []string{".:."}, // The mapping directories ) // 注册 WasmEdge-tensorflow 和 WasmEdge-image var tfobj = wasmedge.NewTensorflowImportObject() var tfliteobj = wasmedge.NewTensorflowLiteImportObject() vm.RegisterImport(tfobj) vm.RegisterImport(tfliteobj) var imgobj = wasmedge.NewImageImportObject() vm.RegisterImport(imgobj) // 实例化 wasm vm.LoadWasmFile("rust_mobilenet_food_lib.so") vm.Validate() return vmConf, vm
}

