非阻塞的 HTTP 客户端程序的 源代码在这里 。下面的 main() 函数开启了两个 HTTP 连接。它同时保持两个连接开启，并轮流查看是否有数据传输进来。换句话说，这两个连接并不会相互阻塞。他们的数据在传输进来的时候被同时（或者轮流）处理。 use httparse::{Response, EMPTY_HEADER};
use std::io::{self, Read, Write};
use std::str::from_utf8;
use wasmedge_wasi_socket::TcpStream; fn main() { let req = "GET / HTTP/1.0\n\n"; let mut first_connection = TcpStream::connect("127.0.0.1:80").unwrap(); first_connection.set_nonblocking(true).unwrap(); first_connection.write_all(req.as_bytes()).unwrap(); let mut second_connection = TcpStream::connect("127.0.0.1:80").unwrap(); second_connection.set_nonblocking(true).unwrap(); second_connection.write_all(req.as_bytes()).unwrap(); let mut first_buf = vec![0; 4096]; let mut first_bytes_read = 0; let mut second_buf = vec![0; 4096]; let mut second_bytes_read = 0; loop { let mut first_complete = false; let mut second_complete = false; if !first_complete { match read_data(&mut first_connection, &mut first_buf, first_bytes_read) { Ok((bytes_read, false)) => { first_bytes_read = bytes_read; } Ok((bytes_read, true)) => { println!("First connection completed"); if bytes_read != 0 { parse_data(&first_buf, bytes_read); } first_complete = true; } Err(e) => { println!("First connection error: {}", e); first_complete = true; } } } if !second_complete { match read_data(&mut second_connection, &mut second_buf, second_bytes_read) { Ok((bytes_read, false)) => { second_bytes_read = bytes_read; } Ok((bytes_read, true)) => { println!("Second connection completed"); if bytes_read != 0 { parse_data(&second_buf, bytes_read); } second_complete = true; } Err(e) => { println!("Second connection error: {}", e); second_complete = true; } } } if first_complete && second_complete { break; } }
} 使用如下命令来编译 Rust 程序。 cargo build --target wasm32-wasi --release 使用如下命令在 WasmEdge 中运行程序。 wasmedge target/wasm32-wasi/release/nonblock_http_client.wasm

