非阻塞的 HTTP 服务器程序的 源代码在这里 。下面的 main() 函数开启了一个 HTTP 服务器。它同时从多个开启的连接中接收事件，并通过调用注册在每个连接的异步处理函数来处理这些事件。服务器可以同时从多个开启的连接中处理事件。 fn main() -> std::io::Result<()> { let mut poll = Poll::new(); let server = TcpListener::bind("127.0.0.1:1234", true)?; println!("Listening on 127.0.0.1:1234"); let mut connections = HashMap::new(); let mut handlers = HashMap::new(); const SERVER: Token = Token(0); let mut unique_token = Token(SERVER.0 + 1); poll.register(&server, SERVER, Interest::Read); loop { let events = poll.poll().unwrap(); for event in events { match event.token { SERVER => loop { let (connection, address) = match server.accept(FDFLAGS_NONBLOCK) { Ok((connection, address)) => (connection, address), Err(ref e) if e.kind() == std::io::ErrorKind::WouldBlock => break, Err(e) => panic!("accept error: {}", e), }; println!("Accepted connection from: {}", address); let token = unique_token.add(); poll.register(&connection, token, Interest::Read); connections.insert(token, connection); }, token => { let done = if let Some(connection) = connections.get_mut(&token) { let handler = match handlers.get_mut(&token) { Some(handler) => handler, None => { let handler = Handler::new(); handlers.insert(token, handler); handlers.get_mut(&token).unwrap() } }; handle_connection(&mut poll, connection, handler, &event)? } else { false }; if done { if let Some(connection) = connections.remove(&token) { connection.shutdown(Shutdown::Both)?; poll.unregister(&connection); handlers.remove(&token); } } } } } }
} handle_connection() 函数处理来自于开启的连接的数据。当前它只是将请求的内容写回响应中。这同样是以异步的形式完成的，意味着 handle_connection() 函数为响应创建了一个事件，然后将事件放入了一个队列中。主程序循环处理这些事件，并在等待来自其他连接的数据时发送这些响应。 fn handle_connection( poll: &mut Poll, connection: &mut TcpStream, handler: &mut Handler, event: &Event,
) -> io::Result<bool> { if event.is_readable() { let mut connection_closed = false; let mut received_data = vec![0; 4096]; let mut bytes_read = 0; loop { match connection.read(&mut received_data[bytes_read..]) { Ok(0) => { connection_closed = true; break; } Ok(n) => { bytes_read += n; if bytes_read == received_data.len() { received_data.resize(received_data.len() + 1024, 0); } } Err(ref err) if would_block(err) => { if bytes_read != 0 { let received_data = &received_data[..bytes_read]; let mut bs: parsed::stream::ByteStream = match String::from_utf8(received_data.to_vec()) { Ok(s) => s, Err(_) => { continue; } } .into(); let req = match parsed::http::parse_http_request(&mut bs) { Some(req) => req, None => { break; } }; for header in req.headers.iter() { if header.name.eq("Conntent-Length") { let content_length = header.value.parse::<usize>().unwrap(); if content_length > received_data.len() { return Ok(true); } } } println!( "{:?} request: {:?} {:?}", connection.peer_addr().unwrap(), req.method, req.path ); let res = Response { protocol: "HTTP/1.1".to_string(), code: 200, message: "OK".to_string(), headers: vec![ Header { name: "Content-Length".to_string(), value: req.content.len().to_string(), }, Header { name: "Connection".to_string(), value: "close".to_string(), }, ], content: req.content, }; handler.response = Some(res.into()); poll.reregister(connection, event.token, Interest::Write); break; } else { println!("Empty request"); return Ok(true); } } Err(ref err) if interrupted(err) => continue, Err(err) => return Err(err), } } if connection_closed { println!("Connection closed"); return Ok(true); } } if event.is_writable() && handler.response.is_some() { let resp = handler.response.clone().unwrap(); match connection.write(resp.as_bytes()) { Ok(n) if n < resp.len() => return Err(io::ErrorKind::WriteZero.into()), Ok(_) => { return Ok(true); } Err(ref err) if would_block(err) => {} Err(ref err) if interrupted(err) => { return handle_connection(poll, connection, handler, event) } Err(err) => return Err(err), } } Ok(false)
} 使用如下命令来编译 Rust 程序。 cargo build --target wasm32-wasi --release 使用如下命令在 WasmEdge 中运行程序。 $ wasmedge target/wasm32-wasi/release/poll_http_server.wasm
